const block2 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li", tags, suffix)} data-ui5-external-action-item-id="${ifDefined(item.refItemid)}" icon="${ifDefined(item.icon)}" type="Active" @ui5-_press="${ifDefined(item.press)}">${ifDefined(item.text)}</${scopeTag("ui5-li", tags, suffix)}>`;


export default block0;
